import React from 'react';
import '../components/Main.css';
import Container from '@material-ui/core/Container';


function Main(){
    return (
        <Container  className='about-component'>
           <p className='about-title'>Hello, My name is</p>
           <h1>Mohammed Naeem.</h1>
           <h1>And I love building things!</h1>

        </Container>
    )
}

export default Main;
